// Get test Suite and Test Step
testSuite = testRunner.testCase.testSuite;
testStep=testSuite.testCases["TC_18_E2E(With Groovy Script)Get_All_Country_Details_and_verify_each_detail"].testSteps["Get all details of a country"];


// Get Property From Suite Level
countryCodeFromProp =testSuite.getPropertyValue("TSP_105_CNTRY_India");
log.info ("Country to set :"+countryCodeFromProp)

// Get Rquest XML
xmlRequest =testStep.getPropertyValue("Request");

// Get Xml Holder
xmlHolder = new XmlHolder (xmlRequest);

// Set Value Of County Code in Request XML
xmlHolder.setNodeValue("//web:sCountryISOCode",countryCodeFromProp)

// Get Updated Xml
xmlRequest = xmlHolder.getXml();

// Update Request In test Step (Get all details of a country)
testStep.setPropertyValue("Request",xmlRequest)

// Run Test Step
testStep.run(testRunner,context);


// Get Reponse XML
xmlReponse = testStep.getPropertyValue("Response");

// Get Xml Holder
xmlHolder = new XmlHolder(xmlReponse);

// Get Values Received in Responses
 countryISOCode 		= xmlHolder.getNodeValue("//m:sISOCode");
 countryName 			= xmlHolder.getNodeValue("//m:sName");; 
 countryCapitalCity 	= xmlHolder.getNodeValue("//m:sCapitalCity"); 
 countryPhoneCode 		= xmlHolder.getNodeValue("//m:sPhoneCode"); 
 countryContinentCode 	= xmlHolder.getNodeValue("//m:sContinentCode"); 
 countryCurrencyISOCode 	= xmlHolder.getNodeValue("//m:sCurrencyISOCode"); 
 countryFlag 			= xmlHolder.getNodeValue("//m:sCountryFlag"); 
 countryLanguage 		= xmlHolder.getNodeValue("//m:Languages//m:sName");
 languageISOCode 		= xmlHolder.getNodeValue("//m:Languages//m:sISOCode");


log.info (" For Given Country :"+countryCodeFromProp +" Details found as 'Country Name="+countryName+"' 'Country ISO Code ="+countryISOCode+
"' 'Capital City ="+countryCapitalCity+"' 'Phone Code="+countryPhoneCode+"' 'Continent Code="+countryContinentCode+"' 'Currency ISO Code ="+countryCurrencyISOCode
+"' 'FlagURL="+countryFlag+"' 'Language="+countryLanguage+"' 'Language ISO Code="+languageISOCode+"'");

// Verity Country ISO Code Request VS Reponse 
assert countryCodeFromProp.contains(countryISOCode)


// Get Test Step (Get Name of Country with ISO Code)
